import logo from './logo.svg';
import './App.css';
import {BrowserView, MobileView} from 'react-device-detect'

function App() {
  return(
      <div className="App">
        <BrowserView>
          데스크톱브라우져!
        </BrowserView>
        <MobileView>
          모바일 브우져!
        </MobileView>
      </div>
  );
}

export default App;
